const ActivityScreen = () => {
  const navigation = useNavigation();
  const [searchQuery, setSearchQuery] = useState("");
  const [dates, setDates] = useState([]);
  const [selectedDate, setSelectedDate] = useState(
    moment().format("YYYY-MM-DD")
  );
  const [tasks, setTasks] = useState([]); // State untuk daftar tugas
  const flatListRef = useRef(null);

  useEffect(() => {
    moment.updateLocale("id", {
      months: [
        "Januari",
        "Februari",
        "Maret",
        "April",
        "Mei",
        "Juni",
        "Juli",
        "Agustus",
        "September",
        "Oktober",
        "November",
        "Desember",
      ],
      weekdaysShort: ["Min", "Sen", "Sel", "Rab", "Kam", "Jum", "Sab"],
    });

    const backAction = () => {
      navigation.reset({
        index: 0,
        routes: [{ name: "Home" }],
      });
      return true;
    };

    const backHandler = BackHandler.addEventListener(
      "hardwareBackPress",
      backAction
    );

    generateDates();
    fetchTasks(); // Panggil fungsi untuk mengambil tugas
    return () => backHandler.remove();
  }, [navigation]);

  // Menghasilkan tanggal untuk satu bulan penuh
  const generateDates = () => {
    let tempDates = [];
    const startOfMonth = moment().startOf("month");
    const endOfMonth = moment().endOf("month");

    for (let day = startOfMonth.date(); day <= endOfMonth.date(); day++) {
      tempDates.push(moment().date(day));
    }
    setDates(tempDates);

    setTimeout(() => {
      const todayIndex = tempDates.findIndex(
        (date) => date.format("YYYY-MM-DD") === moment().format("YYYY-MM-DD")
      );
      if (flatListRef.current) {
        flatListRef.current.scrollToIndex({
          index: todayIndex,
          animated: true,
        });
      }
    }, 100);
  };

  // Fungsi untuk mengambil tugas
  const fetchTasks = () => {
    // Dummy data untuk tugas
    const dummyTasks = [
      {
        id: "1",
        title: "Tugas 1",
        description: "asu",
        dueDate: selectedDate,
        status: "Selesai",
      },
    ];

    setTasks(dummyTasks);
  };

  const filteredTasks = tasks.filter((task) => task.dueDate === selectedDate);

  return (
    <View style={styles.container}>
      <StatusBar backgroundColor="#f2fafe" />
      <View style={styles.fixedHeader}>
        <View style={styles.padding}>
          <View style={styles.searchContainer}>
            <Ionicons
              name="search"
              size={20}
              color="#2263FF"
              style={styles.icon}
            />
            <TextInput
              style={styles.searchInput}
              placeholder="Cari aktivitas..."
              placeholderTextColor="#888"
              value={searchQuery}
              onChangeText={(text) => setSearchQuery(text)}
            />
          </View>

          <Text style={styles.monthYearText}>
            {moment().format("MMMM YYYY")}
          </Text>
        </View>
        <View style={styles.DateMoment}>
          <FlatList
            ref={flatListRef}
            data={dates}
            horizontal
            showsHorizontalScrollIndicator={false}
            contentContainerStyle={styles.dateList}
            keyExtractor={(item) => item.format("YYYY-MM-DD")}
            renderItem={({ item }) => (
              <TouchableOpacity
                style={[
                  styles.dateItem,
                  selectedDate === item.format("YYYY-MM-DD") &&
                    styles.dateItemSelected,
                ]}
                onPress={() => setSelectedDate(item.format("YYYY-MM-DD"))}
              >
                <Text
                  style={[
                    styles.dateText,
                    selectedDate === item.format("YYYY-MM-DD") &&
                      styles.dateTextSelected,
                  ]}
                >
                  {item.format("DD")}
                </Text>
                <Text
                  style={[
                    styles.dayText,
                    selectedDate === item.format("YYYY-MM-DD") &&
                      styles.dayTextSelected,
                  ]}
                >
                  {item.format("ddd")}
                </Text>
              </TouchableOpacity>
            )}
            initialScrollIndex={dates.findIndex(
              (date) =>
                date.format("YYYY-MM-DD") === moment().format("YYYY-MM-DD")
            )}
            getItemLayout={(data, index) => ({
              length: 80,
              offset: 77 * index,
              index,
            })}
          />
        </View>
      </View>

      {/* Tampilkan Tugas */}
      <ScrollView contentContainerStyle={styles.scrollContent}>
        {filteredTasks.length > 0 ? (
          filteredTasks.map((task) => (
            <Task key={task.id} task={task} onPress={() => {}} />
          ))
        ) : (
          <View style={styles.wpNotFound}>
            <SvgXml xml={DontTask} style={styles.DontIconList} />
          </View>
        )}
      </ScrollView>
    </View>
  );
};

